import FriendlyPic from "../images/friendlyPic.jpg";

const friendlyImgStyles = {
  backgroundImage: "url(" + FriendlyPic + ")",
  width: "100%",
};

const FriendlyAd = () => {
  return (
    <div className="friendly-container mt-8 flex font-serif text-slate-50 mr-20 ">
      <div
        className="friendly-img rounded-lg bg-cover bg-center flex "
        style={friendlyImgStyles}
      >
        <h3>Fast Service</h3>
        <h3>Fair Fees</h3>
        <h3>Family friendly enviornment</h3>
      </div>
    </div>
  );
};
export default FriendlyAd;
